import React, { useState, useEffect } from "react";
import SellForm from "./SellForm";
import useKrakenPrices from "../Cryptos/KrakenApi";
import "./style.css";

const Profile = ({ onLogout }) => {
    const user = JSON.parse(localStorage.getItem("user"));
    const [holdings, setHoldings] = useState([]);
    const [history, setHistory] = useState([]);
    const [sellData, setSellData] = useState(null);
    const prices = useKrakenPrices(holdings.map(h => h.cryptoSymbol));

    const loadHoldingsAndHistory = () => {
        fetch(`http://localhost:8080/api/trade/holdings/${user.id}`)
            .then(res => res.json())
            .then(data => setHoldings(data));

        fetch(`http://localhost:8080/api/trade/history/${user.id}`)
            .then(res => res.json())
            .then(data => setHistory(data));
    };

    useEffect(() => {
        if (user?.id) {
            loadHoldingsAndHistory();
        }
    }, []);

    return (
        <div className="allProfileInfo">
            <div className="profile">
                <div className="profileInfo">
                    <h1>{user?.name}</h1>
                    <p>{user?.email}</p>
                </div>
                <div className="balance"><h1>Balance: {user?.balance.toFixed(2)}</h1></div>
                <div className="profileButtons">
                    <button>Reset</button>
                    <button onClick={onLogout}>Logout</button>
                </div>
            </div>

            <div className="profileInfo2">
                <div className="boxLists">
                    <div className="headerLists"><h1>Holdings</h1></div>
                    <div className="infoLists">
                        {holdings.length > 0 ? (
                            <table>
                                <thead>
                                    <tr>
                                        <th>Symbol</th>
                                        <th>Name</th>
                                        <th>Quantity</th>
                                        <th></th>
                                    </tr>
                                </thead>
                                <tbody>
                                    {holdings.map((h, index) => (
                                        <tr key={index}>
                                            <td>{h.cryptoSymbol}</td>
                                            <td>{h.cryptoName}</td>
                                            <td>{h.quantity}</td>
                                            <td>
                                                <button onClick={() => setSellData({
                                                    symbol: h.cryptoSymbol,
                                                    name: h.cryptoName,
                                                    maxQuantity: h.quantity,
                                                    price: prices[h.cryptoSymbol] || "Loading..."
                                                })}>
                                                    Sell
                                                </button>
                                            </td>
                                        </tr>
                                    ))}
                                </tbody>
                            </table>
                        ) : <p>No holdings yet</p>}
                    </div>
                </div>

                <div className="boxLists">
                    <div className="headerLists"><h1>History</h1></div>
                    <div className="infoLists">
                        {history.length > 0 ? (
                            <table>
                                <thead>
                                    <tr>
                                        <th>Symbol</th>
                                        <th>Name</th>
                                        <th>Type</th>
                                        <th>Quantity</th>
                                        <th>Time</th>
                                    </tr>
                                </thead>
                                <tbody>
                                    {history.map((h, index) => (
                                        <tr key={index}>
                                            <td>{h.cryptoSymbol}</td>
                                            <td>{h.cryptoName}</td>
                                            <td>{h.type}</td>
                                            <td>x{h.quantity}</td>
                                            <td>{h.timePurchase}</td>
                                        </tr>
                                    ))}
                                </tbody>
                            </table>
                        ) : <p>No transactions made yet</p>}
                    </div>
                </div>
            </div>

            {sellData && (
                <SellForm
                    userId={user.id}
                    symbol={sellData.symbol}
                    name={sellData.name}
                    maxQuantity={sellData.maxQuantity}
                    price={sellData.price}
                    onClose={() => setSellData(null)}
                    onSellSuccess={loadHoldingsAndHistory}
                />
            )}
        </div>
    );
};

export default Profile;
